import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('domcontentloaded');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Set mobile viewport
    await page.setViewportSize({ width: 375, height: 667 });

    // Open mobile menu by clicking the nav-menu element
    await page.waitForSelector('.nav-menu', { timeout: 5000 });
    await page.click('.nav-menu');

    // Wait for mobile menu to be visible and take screenshot
    await page.waitForSelector('.mobile-menu-overlay.show', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_menu_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_menu_open.png'));

    // Click on a menu item (Electronics)
    await page.waitForSelector('.mobile-menu a[href="#"]', { timeout: 5000 });
    const menuItems = await page.$$('.mobile-menu a[href="#"]');
    await menuItems[0].click(); // Click first menu item

    // Wait briefly for any navigation/action
    await page.waitForTimeout(1000);

    // Take final screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_menu_navigated.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_menu_navigated.png'));

    return {
      success: true,
      action: "Successfully opened mobile menu and navigated to Electronics category",
      extractedData: {
        menuItemsCount: menuItems.length,
        firstMenuItem: await menuItems[0].textContent()
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete mobile menu navigation test",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
